CREATE TABLE churn (
    CustomerID INTEGER NOT NULL PRIMARY KEY,
    Churn INT NOT NULL,
    Tenure INTEGER,
    PreferredLoginDevice VARCHAR(12) NOT NULL,
    CityTier INTEGER NOT NULL,
    WarehouseToHome INTEGER,
    PreferredPaymentMode VARCHAR(16) NOT NULL,
    Gender VARCHAR(6) NOT NULL,
    HourSpendOnApp INTEGER,
    NumberOfDeviceRegistered INTEGER NOT NULL,
    PreferedOrderCat VARCHAR(18) NOT NULL,
    SatisfactionScore INTEGER NOT NULL,
    MaritalStatus VARCHAR(8) NOT NULL,
    NumberOfAddress INTEGER NOT NULL,
    Complain BIT NOT NULL,
    OrderAmountHikeFromlastYear INTEGER,
    CouponUsed INTEGER,
    OrderCount INTEGER,
    DaySinceLastOrder INTEGER,
    CashbackAmount INTEGER NOT NULL
);


